INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, "2015/12/17 15:00:00", 1, -371.5, "2030/12/17 14:59:59", "アメス", 0, 0.0, 1, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", 46, 123001, 1, 0, 46001);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, "2015/12/17 15:00:00", 2, -416.5, "2030/12/17 14:59:59", "シズル", 0, 0.0, 1, "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", 47, 104901, 2, 0, 47001);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (9.32, "2015/12/17 15:00:00", 2, -416.5, "2030/12/17 14:59:59", "リノ", 0, 0.0, 1, "ほんとーに不思議な場所ですね～\nお兄ちゃんが冒険を頑張れるよう\nおまじないをかけてあげますねっ\nフレーフレー、お・兄・ちゃんっ♪", 47, 101101, 1, 0, 47002);
